    return (
        <ScrollView style={{backgroundColor: 'powderblue'}}>
            <View>
                <Text style={{
                    color: 'black',
                    fontSize: 60,
                }}>
                    Laundry Shop 1
                </Text>
                <View>
                    <View>

                    </View>
                </View>
            </View>
        </ScrollView>
    )
}
